import React from "react";
import { Link } from "react-router-dom";

const Navigation = () => (
  <ul>
    <li>
      <Link to="/">Mieszkania</Link>
    </li>
    <li>
      <Link to="/">Mieszkania</Link>
    </li>
    <li>
      <Link to="/rooms">Pokoje</Link>
    </li>
    <li>
      <Link to="/notes">Domy</Link>
    </li>
  </ul>
);

export default Navigation;
